import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import AddCar from './AddCar'; // Import the AddCar component

const Dashboard = () => {
  const [showAddCar, setShowAddCar] = useState(false);

  const toggleAddCar = () => {
    setShowAddCar(!showAddCar);
  };

  return (
    <div className="navbar">
      <Link to="/">Dashboard</Link>
      <button onClick={toggleAddCar}>Add Car</button>
      {/* Other buttons for different functionalities */}
      {showAddCar && <AddCar />} {/* Render AddCar component conditionally */}
    </div>
  );
};

export default Dashboard;
